import React, { Component } from "react";
import { MainHeader } from "../Components/MainBackground";


class ElvesNotes extends Component {
  render() {
    return (
      <MainHeader>
        <h2>ElvesNotes</h2>
      </MainHeader>
    );
  }
}

export default ElvesNotes;
